# @param {String} s
# @param {Integer} k
# @return {Integer}
def longest_substring(s, k)
    len = s.length
    counts = get_counts(s)
    # puts counts.to_s
    helper(s, counts, 0, len - 1, k, {})
end

def helper(s, counts, left, right, k, cache)
    # puts [counts, left, right].to_s
    # puts "hit" if cache[[left,right]]
    if left > right || counts.all?{|e| e < k }
        0
    elsif counts.all? {|c| c == 0 || c >= k }
        right - left + 1
    elsif cache[[left,right]]
        cache[[left,right]]
    else
        lefti = s[left].ord - 'a'.ord
        counts[lefti] -= 1
        left_res = helper(s, counts, left + 1, right, k, cache)

        # return left_res if left_res > 0

        counts[lefti] += 1

        righti = s[right].ord - 'a'.ord
        counts[righti] -= 1
        right_res = helper(s, counts, left, right - 1, k, cache)
        counts[righti] += 1
        cache[[left, right]] = [left_res, right_res].max
    end
end

def get_counts(s)
    counts = Array.new(26, 0)
    s.each_char do |ch|
        indx = ch.ord - 'a'.ord
        counts[indx] += 1
    end
    counts
end

