# @param {Character[][]} grid
# @return {Boolean}
def contains_cycle(grid)
    m = grid.length
    n = grid[0].length

    for i in 0...m
        for j in 0...n
            if grid[i][j].is_a?(String) and cycle?(grid, i, j, m, n)
                return true
            end
        end
    end
    false
end

def cycle?(grid, r, c, m, n)
    que = Queue.new
    que.enq([r,c])

    while not que.empty?

        visiting = {}
        puts "... que len #{que.length}"
        que.size.times do
            i, j = que.deq

            char = grid[i][j]
            grid[i][j] = char.ord

            if i + 1 < m && grid[i + 1][j] == char
                puts "i + 1 #{[i + 1,j]} - #{visiting}" if i == 1 && j == 1
                return true if visiting[[i + 1, j]]
                que.enq([i + 1, j])
                visiting[[i + 1, j]] = true
            end
            if i - 1  >= 0 and grid[i - 1][j] == char
                puts "i - 1 #{ [i - 1, j]} - #{visiting}" if i == 1 && j == 1
                return true if visiting.key?([i -1, j])
                que.enq([i -1, j])
                visiting[[i-1, j]] = true
            end
            if j + 1 < n and grid[i][j + 1] == char
                puts "j + 1 #{[i, j + 1]} - #{visiting}" if i == 1 && j == 1
                return true if visiting.key?([i, j + 1])
                que.enq([i, j + 1])
                visiting[[i, j + 1]] = true
            end
            if i == 1 && j == 1
                puts "j - 1 #{[i,j - 1]} - #{visiting} - #{grid[i][j - 1]} - #{char}"
            end
            if j - 1 >= 0 and grid[i][j - 1] == char
                puts "j - 1 #{[i,j - 1]} - #{visiting}" if i == 1 && j == 1
                return true if visiting[[i, j-1]]
                visiting[[i, j -1]] = true
                que.enq([i, j -1])
            end
        end
    end

    false
end



