def permutation(str)
    _hsh = {}
    str.split('').sort.each do |chr|
        _hsh[chr] ||= 0
        _hsh[chr] += 1
    end

    chars = []
    count = []
    _hsh.each_pair do |chr, c|
        chars << chr
        count << c
    end

    len = str.length

    result = Array.new(len)
    permutaions = []

    helper(0, result, chars, count, len, permutaions)

    permutaions

end

def helper(i, result, chars, count, len, permutaions)
    if i == len
        permutaions << result.join
        return
    end

    chars.each_with_index do |chr, j|
        next if count[j] == 0

        result[i] = chr
        count[j] -= 1
        helper(i + 1, result, chars, count, len, permutaions)
        count[j] += 1
    end
end





