def detect_capital_use(word)
    n = word.length
    return true if n == 1

    if word[1].ord <= 90 ## upcase
        word.each_char.all?{|c| c.ord <= 90 }
    else # downcase
        word[1..-1].each_char.all?{|c| c.ord >= 97 }
    end
end


