# @param {Integer[]} prices
# @return {Integer}
def max_profit(prices)
    helper(prices, 0, prices.length - 1)
end

def helper(prices, l, r)
    max = 0
    s, e = find_profitable_range(prices, l, r)
    # puts "  s, e : #{[s, e]}"
    if s && e
        max =
            if e - s == 1
                [
                    profit(prices, s, e) + helper(prices, e + 2, r),
                    profit(prices, s, e - 1) + helper(prices, e + 1, r)
                ].max
            else
                [
                    profit(prices, s, e) + helper(prices, e + 2, r),
                    profit(prices, s, e - 1) + helper(prices, e + 1, r)
                ].max
            end

    end
    max
end

def profit(prices, s, e)
    e <= s ? 0 : prices[e] - prices[s]
end

def find_profitable_range(prices, l, r)
    return if r <= l

    s = l
    while s < r && prices[s] >= prices[s + 1]
        s += 1
    end

    e = s
    while e < r && prices[e] <= prices[e + 1]
        e += 1
    end
    [s, e]
end


